import React from 'react';

export default function Playlist(props) {
  return (
    <div className="col-6">
      <div className="tile double totoro">
        <div className="player text-left">
          <h4>
            <u>Shower Order:</u>
            <div>1. Jackeline</div>
            <div>2. Juan</div>
            <div>3. Manuel{props.block}</div>
          </h4>
        </div>
      </div>
    </div>
  );
}
